(* ::Package:: *)

<<Anyonica`


ZestedFusionRings[ R_ ] :=
	Module[ { actions, gradingMap, UG, invertibles, invRe, ple, w, cocycles, allCocycles, mt,zestedMultTabs, fpDims },
		
		(* For now we only look at universal grading group *)
		{ gradingMap, UG } = 
			EchoLabel["UniversalGrading"] @ 
			UniversalGrading @ R;
		
		(* Find all point-like elements with trivial grade *)
		fpDims = FPDims[R];
		
		ple = 
			EchoLabel["inv(R_e)"] @
			Keys @
			Cases[
				gradingMap, 
				arr_ /; Values[arr] == 1 && fpDims[[ Keys[arr] ]] == 1  
			];
		
		(* These elements form a group: invRe. This will be the G-Module *)
		invRe =
			FusionRing[ "MultiplicationTable" -> MT[R][[ ple, ple, ple ]] ];
		
		(* If invRe is non-commutative the procedure doesn't work. *)
		If[ !CommutativeQ[invRe], Return @ { R } ];
			
		actions = 
			EchoLabel["Actions"] @
			GroupActions[ UG, invRe ]; (* Function defined below *)
			
		allCocycles = 
			EchoLabel["Cocycles"] @
			DeleteDuplicates[
				Join @@
				Table[ 
					BackTrackNormalized2Cocycles[ UG, invRe, a ]/.({i_,j_}->k_):>({i,j}->ple[[k]]),
					{ a, actions }
				]
			];
		
		mt = MultiplicationTable[R];
		
		zestedMultTabs = 
			EchoLabel["ZestedMultTabs"] @
			DeleteDuplicates @
			Table[
				zest2[ mt, gradingMap, w ], (* Function defined below *)
				{ w, allCocycles }
			];
			
		DeleteDuplicates[
			FusionRing[ "MultiplicationTable" -> # ]& /@
			zestedMultTabs,
			EquivalentFusionRingsQ
		]
		
	];


(* ::Subsection:: *)
(*Cocycles*)


(* Code to calculate 2-cocycles from a group (seen as a fusion ring with group mult rules) 
   to an abelian group via an action. The cocycles are normalized in the sense that they map
   { 1, g } -> 1, { g, 1 } -> 1 *)

BackTrackNormalized2Cocycles[
	G_FusionRing, (* grading group *)
	M_FusionRing?CommutativeQ, (* invertibles in trivial component *)
	action_ (* action that makes M a G-module. This should be a function (or association) that maps integers to permutation vectors *)
	] :=
	BackTrackNormalized2Cocycles[ G, M, action ] =
	Module[ { GNRules, MNRules, GProd, MProd, GElements, MElements, cocycleEquations, leftAct, 
		CompleteCocycle, trivialRules, unknowns, cocycles, w, updatedEquations },
		
		(* Basic check *)
		If[ !GroupQ[G] || !GroupQ[M], Print["Rings should be group rings"]; Abort[] ];
		
		(* Group elements are integers *)
		GElements = Range @ Rank @ G;
		MElements = Range @ Rank @ M;
		
		(* Define multiplication of group elements *)
		GNRules = Dispatch[ ( { #1, #2 } -> #3 )& @@@ NonZeroStructureConstants @ G ]; 
		MNRules = Dispatch[ ( { #1, #2 } -> #3 )& @@@ NonZeroStructureConstants @ M ];
		
		(* We need to hold elements that aren't integers. Otherwise we get array errors *)
		GProd[ i_Integer, j_Integer ] := { i, j }/.GNRules;
		MProd[ i_Integer, j_Integer ] := { i, j }/.MNRules;
		
		(* Define action via permutation *)
		leftAct[ g_Integer ][ m_Integer ] := action[g][[m]];

		(* Set up cocycle equations. The variables are of the form w[i,j] *)
		cocycleEquations = 
			Flatten @ 
			Table[
			  MProd[ leftAct[ g1 ] @  w[ g2, g3 ], w[ g1, GProd[ g2, g3 ] ] ] == 
				MProd[ w[ GProd[ g1, g2 ], g3 ], w[ g1, g2 ] ],
				{ g1, GElements },
				{ g2, GElements },
				{ g3, GElements }
			];
		
		(* Backtrack on cocycles *)
		CompleteCocycle[ {}, {}, rules_ ] := 
			Sow[ rules ];
			
		CompleteCocycle[ eqns_, unknowns_, rules_ ] := 
			Module[ { newRule },
				If[ MemberQ[ False ] @ eqns, Return @ {} ];
				Do[
					newRule = First[unknowns] -> g; 
					
					CompleteCocycle[ 
						DeleteCases[True] @ ReplaceAll[newRule] @ eqns
						,
						Rest @ unknowns
						,
						Append[ newRule ] @ rules
					]
					, 
					{ g, MElements }
				]
			];
			
		cocycles = 
			Reap[
				(* Cocycles are normalized *)
				trivialRules = 
					Union[ 
						Table[ w[ 1, h ] -> 1, { h, GElements } ],
						Table[ w[ h, 1 ] -> 1, { h, GElements } ]
					];
				
				(* Equations contain no trivial cocycles  *)
				updatedEquations =
					DeleteCases[True] @ ReplaceAll[trivialRules] @ cocycleEquations;
				
				unknowns = 
					GetVariables[ updatedEquations, w ];
				
				CompleteCocycle[ 
					updatedEquations,
					unknowns,
					trivialRules
				]
			][[2]]/.w->List/.{{x__}}:>{x}
]


